// src/App.js
import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Features from './components/Features';
import MSP from './components/MSP';
import Pricing from './components/Pricing';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <Features />
      <MSP />
      <Pricing />
    </div>
  );
}

export default App;
